import React, { Profiler } from 'react';
import './App.css';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

const details = [
  {
    image: "https://cdn02.nintendo-europe.com/media/images/10_share_images/games_15/virtual_console_nintendo_3ds_7/SI_3DSVC_SuperMarioBros.jpg",
    resolver: "(parent, args, context, info) => data",
    tricks: "pagination",
    name: "super mario bros"
  },
  {
    image: "https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg",
    resolver: "(parent, args, context, info) => data",
    tricks: "pagination",
    name: "identity"
  },
  {
    image: "https://github.com/4yerik/images/blob/master/projects/website.PNG?raw=true",
    name: "nothing"
  }

];



const callback = (id, phase, actualTime, baseTime, startTime, commitTime) => {
  // console.log(`${id}'s ${phase} phase:`);
  // console.log(`Actual time: ${actualTime}`);
  // console.log(`Base time: ${baseTime}`);
  // console.log(`Start time: ${startTime}`);
  // console.log(`Commit time: ${commitTime}`);
};


const Projects = () => (
  <React.Fragment>
    <div className="trial section">

    </div>
    <div className="trial2 section">
    <img className="round" src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>


    </div>

    <div className="section">
    <Carousel
            showArrows={true}
            showThumbs={false}
            useKeyboardArrows={true}
            dynamicHeight={true}
            showStatus={false}
            infiniteLoop={true}
            showIndicators={true}
            autoPlay={true}
            stopOnHover={true}
            interval={5000}
          >
            <div>
            <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>

              {/* <p className="legend">Legend 2</p> */}
            </div>
            <div>
              <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
              {/* <p className="legend">Legend 3</p> */}
            </div>
          </Carousel>
    </div>
    <section className="section">
      <div className="grid">

        <div className="item1">
          <Carousel
            showArrows={true}
            showThumbs={false}
            useKeyboardArrows={true}
            dynamicHeight={true}
            showStatus={false}
            infiniteLoop={true}
            showIndicators={true}
            autoPlay={true}
            stopOnHover={true}
            interval={5000}
          >
            <div>
            <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>

              {/* <p className="legend">Legend 2</p> */}
            </div>
            <div>
              <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
              {/* <p className="legend">Legend 3</p> */}
            </div>
          </Carousel>
        </div>
        <div className="item2">
          FLUTTER APP
      </div>
        <div className="item3"></div>
        <div className="item4"></div>

      </div>
    </section>


    <section className="section">
      <div className="grid">
        <div className="item1">
          <Carousel
            showArrows={false}
            showThumbs={false}
            showArroshowThumbs={false}
            useKeyboardArrows={true}
            dynamicHeight={true}
            showStatus={false}
            infiniteLoop={true}
            showIndicators={false}
            autoPlay={true}
            stopOnHover={true}
            interval={5000}
          >
            <div>
              {/* <p className="legend">{detail.name}</p>
                    <img className="project-image" src={detail.image}></img> */}
            </div>
            <div>
              <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
              {/* <p className="legend">Legend 2</p> */}
            </div>
            <div>
              <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
              {/* <p className="legend">Legend 3</p> */}
            </div>
          </Carousel>
        </div>
        <div className="item2">
          APOLLO
      </div>
        <div className="item3"></div>
        <div className="item4"></div>
      </div>
    </section>

    <section className="section">
      <div className="grid">
        {/* <div className="item1"> */}
        <Carousel
          className="item1 invisible"
          showArrows={false}
          showThumbs={false}
          showArroshowThumbs={false}
          useKeyboardArrows={true}
          dynamicHeight={true}
          showStatus={false}
          infiniteLoop={true}
          showIndicators={false}
          autoPlay={true}
          stopOnHover={true}
          interval={5000}
        >

          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_level_one.JPG?raw=true"></img>
          </div>
          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_pipes.JPG?raw=true"></img>
          </div>
          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_level_two.JPG?raw=true"></img>
          </div>
          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_mushrooms.JPG?raw=true"></img>
          </div>
          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_castle.JPG?raw=true"></img>
          </div>
          <div>
            <img src="https://github.com/4yerik/images/blob/master/projects/mario_running.JPG?raw=true"></img>
          </div>
        </Carousel>
        {/* </div> */}
        <div className="mario-title-1">
          M
      </div>
        <div className="mario-title-2">
          A
      </div>
